measurements.description:
Three hundred eight flowers and 21 buds on 49 up to 12-cm inflorescences;
plant 43 cm wide x 20 cm tall, in bark in a 19-cm square wood basket;
 sepals and petals sparkling burgundy, significant fenestration, sepals rhomboid, petals spatualate; 

 lip saccate, cream, orange markings, side lobes overlaid red;
 column white; 
 substance medium; texture crystalline.
